class  RankingContentsIdentifire extends Component {
    
    constructor(props){
        super(props)
        this.state={

        }
    }
    
    render() { 
        const {contents} =  this.props;
        
        console.log("Ranking", contents.data)
        return (
            <div>
                  {contents.map((ranking)=>(
                     <div>{ranking}  <br/> </div>            
                  ))}  
            </div>
        );
    }
}
 
export default RankingContentsIdentifire;
